css:
@-moz-document url("https://www.reddit.com/r/dota2") {
.users-online .number:before {
    content: "Reddit's STUNNED ";
}
.users-online .number:after {
    content: " (seconds)";
    text-transform: none;
}
.users-online:after {
    content: "";
    display: inline-block;
    background: #380a0a;
    width: 50px;
    height: 26px;
    float: right;
    margin-top: -5px;
    margin-right: -7px;
    margin-bottom: -10px;
}
.users-online {
    display: inline-block;
    width: 296px;
    font-size: 11px;
    border: 1px #632020 solid;
    background: #a73737;
    text-transform: uppercase;
    color: white;
    font-weight: normal;
    padding: 5px 7px;
}
}
